('ICB0001', 'State portraits of Australian business : a report based on the 1995 business longitudinal survey / Small Business Research Program', 'Small Business Research Program (Australia)\nAustralia. Office of Small Business ; Aquatech Pty. Ltd.', 'Small business -- Australia -- Statistics;\nSmall business -- Australia -- Longitudinal studies;\nBusiness enterprises -- Australia -- Longitudinal studies;\nBusiness enterprises -- Australia -- Statistics', '', '<Canberra : Office of Small Business> ', '', '', 'xii, 139 p. ; 25 cm.. ', '', '1998', '', 'English', '', '\'Prepared by Aquatech Pty Ltd for the Office of Small Business, Department of Workplace Relations and Small Business\' -- Verso t.p. \nChiefly tables. \nAGPS cat. no. 9801853. \nIncludes bibliographical references (p. 120) ', '', 'ISBN:0646335413 ', '', '21129203210002061 ', 'http://catalogimages.johnwiley.com.au/Cover/300W/97807303/9780730314141.jpg', 0),
('ICB0002', 'Microwave and Millimeter-Wave Electronic Packaging.', 'Rick. Sturdivant', 'Electronic books', 'Access available for SLQ members', 'Norwood : Artech House ', '', 'Microwave and Millimeter-Wave Electronic Packaging -- Contents -- Preface -- 1 Introduction -- 1.1Distributed Effects -- 1.1.1Distributed Effects in Lumped Elements -- 1.1.2Undesired Resonances -- 1.1.3Transmission Lines -- 1.1.4Dispersion Effects -- 1.1.5Coupling and Cross-Talk Between Signal Lines -- 1.1.6Parasitic and Grounding Concerns -- 1.2Thermal Effects -- 1.3First-Level Interconnects -- 1.4Second-Level Interconnects -- 1.5Modules -- 1.6Conclusions -- Questions -- References -- 2 Materials -- 2.1Electrical Parameters and Their Measurement -- 2.1.1Dielectric Constant -- 2.1.2Loss Tangent -- 2.1.3Measurement of Dielectric Constants and Loss Tangents -- 2.1.4Metal Electrical Conductivity -- 2.2Mechanical Parameters -- 2.2.1Thermal Conductivity -- 2.2.2Thermal Expansion -- 2.2.3Stress and Strain -- 2.2.4Young\'s Modulus -- Questions -- References -- 3 Ceramic Packaging -- 3.1History of Ceramics -- 3.2Thin-Film Ceramics -- 3.3Advanced Thin-Film Techniques -- 3.4Thick-Film Ceramics -- 3.4.1Thick-Film Paste -- 3.4.2Squeegee -- 3.4.3Frame -- 3.4.4Screen and Mesh -- 3.4.5Emulsion -- 3.4.6Desired Metal Pattern -- 3.4.7Ceramic Substrate -- 3.4.8Printing Machine -- 3.4.9Etching -- 3.4.10Postprocessing -- 3.5Thermally Enhanced Thick-Film Processes -- 3.6High-Temperature Cofired Ceramic (HTCC) -- 3.6.1Slurry -- 3.6.2Tape Casting -- 3.6.3Punching -- 3.6.4Via Filling and Conductor Printing -- 3.6.5Stacking, Pressing, and Cofiring -- 3.6.6Postprocessing -- 3.7Low-Temperature Cofired Ceramic (LTCC) -- Questions -- References -- 4 Laminate Packaging -- 4.1Laminate Board Fabrication -- 4.1.1Database Review and Acceptance -- 4.1.2Artwork Generation -- 4.1.3Clean Layers -- 4.1.4Pattern and Etch -- 4.1.5Bake-Out -- 4.1.6Oxide Treatment of Inner Layers for Adhesion -- 4.1.7Alignment and Lamination. \r\n4.1.8Drill and Deburr -- 4.1.9Through-Hole Plating -- 4.1.10Solder Mask -- 4.1.11Finish Plating -- 4.1.12Silk Screen and CNC Routing -- 4.1.13Electrical Testing and Inspection -- 4.2Cost of Laminates -- 4.3Laminate Circuit Board Tolerances -- 4.4High-Performance Laminate Materials -- 4.5Liquid Crystal Polymer -- 4.6Laminate Multichip Modules -- 4.7Conclusions -- Questions -- References -- 5 First-Level Interconnects -- 5.1Wire Bond Interconnects -- 5.1.1Wire Bond Manufacturing -- 5.1.2Wire Bond Reliability -- 5.1.3Wire Bond Electrical Performance and Modeling -- 5.1.4Straight Wire Bond Between Substrates -- 5.1.5Wire Bond Between an MMIC and Substrate -- 5.1.6Ground Current Parasitics in Wire Bonded Circuits -- 5.1.7Tuning Wire Bond Interconnects -- 5.1.8Other RF Uses for Wire Bonds -- 5.2Ribbon Bonding -- 5.3Flip Chip Interconnects -- 5.3.1Types of Flip Chip Interconnects -- 5.3.2Electrical Modeling of Flip Chip Interconnects -- 5.3.3Parasitic Modes in Flip Chip Interconnects -- 5.3.4Thermal Concerns for Flip Chips -- Questions -- References -- 6 Second-Level Interconnects -- 6.1Electrical Modeling of Surface-Mount Packages -- 6.2Inductance and Capacitance Matrix Method for Package Model Extraction -- 6.3Coupled- Model Method -- 6.4Hybrid Circuit Model -- Questions -- References -- 7 Modules and Motherboards -- 7.1Proper Transmission Line Design -- 7.1.1Conductor-Backed Coplanar Waveguide -- 7.1.2Striplines -- 7.1.3Microstrip Lines -- 7.2Vias for Isolation and Grounding -- 7.3Cavity Resonances -- Questions -- References -- 8 Transitions and 3D Packaging -- 8.1Transitions Between Transmission Lines -- 8.1.1CBCPW to Microstrip Transition -- 8.1.2Cofired Ceramic Microstrip and Stripline Transition -- 8.1.3Laminate Board Microstrip to Stripline Transition -- 8.2Three-Dimensional Packaging. \r\n8.2.1Stacked Substrate Solderless Interconnects -- 8.2.2Highly Integrated Modules with Vertical Transitions -- 8.2.3Using the Package as a Circuit Element: An Integrated 60-GHz Module -- 8.2.4Three-Dimensional Integration by Stacking ICs and Packages -- 8.3Conclusions -- Questions -- References -- 9 Heat Transfer -- 9.1Heat Transfer Mechanisms -- 9.2Amplifier Efficiency and Dissipated Thermal Power -- 9.3Reliability and Arrhenius Equation -- 9.4Device Junction Temperature -- 9.5Junction Temperature with Multiple Material Layers -- 9.6Thermal Simulations Using Spice -- 9.7Thermal Simulation Using the Finite Difference Method -- 9.8Conclusions -- Questions -- References -- 10 Electromagnetic Modeling -- 10.1Quasistatic Simulation of Transmission Lines -- 10.2Method of Moments -- 10.3Finite Element Method -- 10.4Finite Difference Time Domain Method -- 10.5Mode Matching Technique -- 10.6Integrated Methods -- 10.7Domain Decomposition Methods -- Questions -- References -- 11 Conclusions and Future Horizons -- 11.1The 10 Keys to Successful Packaging -- 11.1.1Careful System Architecture and Solid Specifications -- 11.1.2Proper Material Selection -- 11.1.3Electrical Signal Integrity -- 11.1.4Thermal Management -- 11.1.5Proper Electrical Modeling -- 11.1.6Proper Mechanical Modeling -- 11.1.7Design for Manufacturing -- 11.1.8Design for Testability -- 11.1.9Production Process Transition -- 11.1.10Proper Feedback from Field Failures -- 11.2Future for Packaging at Microwave Frequencies -- 11.3Drive for Lower Cost Packaging at Millimeter-Wave Frequencies -- References -- Appendix A -- A.1Scattering Parameters -- A.2Impedance Parameters -- Appendix B -- B.1Multilayer Transmission Line Tool -- B.2Physical Parameters -- B.3Numerical Control -- B.4Analysis -- Appendix C -- C.1Thermal Calculator Software Tool -- About the Author. \r\nIndex. ', '1 online resource (281 pages). ', 'Packaging of electronic components at microwave and millimeter-wave frequencies requires the same level of engineering effort for lower frequency electronics plus a set of additional activities which are unique due to the higher frequency of operation. This resource presents you with the electronic packaging issues unique to microwave and millimeter-wave frequencies and reviews lower frequency packaging techniques so they can be adapted to higher frequency designs. You are provided with 30 practical examples throughout the book, as well as three free downloadable software analysis programs. ', '2014', '1st ed.. ', 'English', '', '', '', 'ISBN:9781608076987 ', '', '21206550180002061', 'https://images-na.ssl-images-amazon.com/images/I/41CDCtld9rL._SX331_BO1,204,203,200_.jpg', 0),
('ICB0003', 'Computer methods and advances in geomechanics / edited by G.Beer, J.R.Booker & P.J.Carter', 'International Conference on Computer Methods and Advances in Geomechanics (7th : 1991 : Cairns, Qld.)', 'Computer-aided engineering;\nRock mechanics -- Congresses;\nSoil mechanics -- Data processing;\nEngineering geology -- Data processing -- Congresses;\nRock mechanics -- Data processing -- Congresses', '', 'Rotterdam : Brookfield, Vt. : Published on behalf of the International Association for Computing Methods and Advances in Geomechanics by A.A. Balkema ', '', '', '3 v. ; 25 cm.. ', '', '1991', '', 'English', '', 'Proceedings of the seventh international conference on computer methods and advances in geomechanics, Cairns, 6-10 May 1991. \nIncludes bibliographies and index. ', '', 'ISBN:9061911893 (set) ', '', '21116073620002061', 'https://i.imgur.com/cSUMetj.jpg', 0),
('ICB0004', 'Computer Forensics : An Essential Guide for Accountants, Lawyers, and Managers', 'Michael. Sheetz', 'Computer crimes -- Investigation;\nElectronic books', 'Access available for SLQ members', 'Somerset : John Wiley & Sons, Incorporated ', '', 'Cover -- Title Page -- Copyright -- Contents -- Introduction -- Acknowledgments -- Chapter 1 A Definition of Computer Forensics -- Introduction -- Forensic Science -- History of Computer Forensics -- World Wide Web -- Hacker Community -- Conclusion -- Notes -- Suggested Reading -- Chapter 2 Basics of Computer Forensic Concepts -- Introduction -- Understanding Digital Evidence -- Input -- Storage -- Processing -- What Computer Data Is -- Output -- Conclusion -- Notes -- Suggested Reading -- Chapter 3 Preservation and Collection of Digital Evidence -- Introduction -- Rules of Evidence -- Preservation -- Collection -- Conclusion -- Note -- Suggested Reading -- Chapter 4 Analysis of Digital Evidence -- Introduction -- Forensic Analysis -- Conclusion -- Notes -- Suggested Reading -- Chapter 5 Reporting and Rendering the Opinion -- Introduction -- Preparing the Report -- Photographic Documentation -- Reporting -- Executive Summary or Abstract -- Table of Contents -- Body or Findings -- Conclusion -- Supporting Documents -- Appendixes -- Presentation -- Trial Process -- Dispute -- Complaint -- Service of Process -- Pretrial -- Trial -- Conclusion -- Suggested Reading -- Chapter 6 Computer Attacks -- Hackers and Phreakz Oh My -- Hackers: Unauthorized Use and Trespassing -- Wireless Hacking -- Malware -- Attacks from the Inside -- Conclusion -- Notes -- Suggested Reading -- Chapter 7 Computers as Tools for Evil -- Introduction -- Computers and Crime -- Identity Theft -- Concealment -- Auction Fraud and Retail Cons -- Counterfeiting and Forgery -- Prostitution -- Securities Fraud -- Conclusion -- Notes -- Chapter 8 Computer Tools and the Forensic Examination -- Introduction -- Assuming Control of the Case -- Understanding the Case -- Evaluating the Evidence -- Examining the \"Live\'\' System. \r\nCollecting Data from a Dead System -- Imaging the Drive -- Data Extraction -- Data Analysis -- Time Frame Analysis -- Hidden Data Aanalysis -- Application and File Analysis -- Ownership Analysis -- Conclusion -- Notes -- Chapter 9 Presenting Digital Evidence in Court -- Introduction -- Evidence -- Types of Evidence -- Expert Witnesses -- Legal Requirements of Evidence -- Search and Seizure -- Conclusion -- Notes -- Index.', '1 online resource (352 pages). ', 'Would your company be prepared in the event of: * Computer-driven espionage * A devastating virus attack * A hacker\'s unauthorized access * A breach of data security? As the sophistication of computer technology has grown, so has the rate of computer-related criminal activity. Subsequently, American corporations now lose billions of dollars a year to hacking, identity theft, and other computer attacks. More than ever, businesses and professionals responsible for the critical data of countless customers and employees need to anticipate and safeguard against computer intruders and attacks. The first book to successfully speak to the nontechnical professional in the fields of business and law on the topic of computer crime, Computer Forensics: An Essential Guide for Accountants, Lawyers, and Managers provides valuable advice on the hidden difficulties that can blindside companies and result in damaging costs. Written by industry expert Michael Sheetz, this important book provides readers with an honest look at the computer crimes that can annoy, interrupt--and devastate--a business. Readers are equipped not only with a solid understanding of how computers facilitate fraud and financial crime, but also how computers can be used to investigate, prosecute, and prevent these crimes. If you want to know how to protect your company from computer crimes but have a limited technical background, this book is for you. Get Computer Forensics: An Essential Guide for Accountants, Lawyers, and Managers and get prepared. ', '2015', '1st ed.. ', 'English', '', '', '', 'ISBN:9780470124024 ', '', '21206348640002061', 'https://images-na.ssl-images-amazon.com/images/I/41hZMu-cDnL._AC_US218_.jpg', 0);
